import React from 'react';
import './App.css';

export default class App extends React.Component {
  handleClick = () => {
    console.log('inchka chka');
  };

  render() {
    const styles = {
      border: '3px solid black',
      width: '400px',
      height: '20px',
      background: 'rgba(0, 0, 0, 0.322)',
    };
    return (
      <div className='App'>
        <button style={styles} onClick={this.handleClick}>
          click me
        </button>
      </div>
    );
  }
}
